B.Iu=new A.bs("Cerberus is using game elements inspired by the existing gaming industry to motivate her crowd of 1000s so they help to convert satellite imagery into maps faster, more thorough and cost effective versus experts. ","In this project my role was to design and implement various features including both the frontend and backend components. some of those features are: \n\n1- Grid System\n     was implemented to translate game world coordinates to latitude and longitude.\n     Also to keep track of where player units are and all actions taken on the map.\n     To create this multiple local hexagonal grids were created, and one global grid was created.\n     The reason behind this is one massive grid over the entire map caused severe performance issues.\n     each cell in a local grid was translated into a global cell using offsets.\n\n2- Map traversal mechanics\n     Each unit the player controlled had a specific range and fuel consumption\n     The range of each unit was calculated and displayed to the user\n     The fuel consumption was also calculated and displayed to the user\n     Each unit position and movement and its validity was synced with the backend\n     All functions created in the engine were replicated on the backed for verification\n     Gamesparks was used to keep track of user unit locations\n\n3- Deploying probes on the map\n     Specific units were able to deploy different types of probes\n     These probes had different types that translated to interest points on the map\n     The grid was used to keep track of each probe fired and its coordinates\n     All probe locations were also synced with Gamesparks backend\n\n4- Fog of War\n     Fog of war is an effect obscuring parts of the map that the player did not explore yet.\n     Each unit had a vision range which was used to calculate the radius where fog dissipates\n     Cleared cells were kept track of on Gamesparks to preserve player progress\n\n The above features are some of the features I helped design and implemented",t.V)
